import React from "react";
import {Tile} from '../tile/Tile.js'

export const TileList = (props) => {
  return (
    <div>
      <ul>
      {props.contacts.map((contact)=>{
        <Tile key={contact} tile={Tile} />
      })}
      </ul>
      
    </div>
  );
};
